    private String tableOwner;
    private String tableName;
    private String synonymName; //for mock tables that point non-unique source / target table names "g76_usl.t_finc_tran", "g73_usl.t_finc_tran"


    TablenameConstants ( final String pTableOwner , final String pTableName, final String pSynonymName )
    {
        tableOwner  = pTableOwner;
        tableName   = pTableName;
        synonymName = pSynonymName;
    }

    public String getTableOwner ()
    {
        return tableOwner;
    }

    public String getTableName ()
    {
        return tableName;
    }

    public String getSynonymName ()
    {
        return synonymName;
    }

    public String getERTableName ()
    {
        return StringUtils.substring( "er_" + tableName , 0 , 30);
    }

    public String getCsvFileName ()
    {
        return tableName + ".csv";
    }

    public String toString ()
    {
        return tableOwner + "." + tableName;
    }
